Welcome to the Korean political arena!

The struggle for power was and remains the main purpose and occupation of many Korean politicians. The methods of their political struggle acquire the most desperate forms.

Features of the game:
• 15 characters created on the basis of real Korean politicians and public persons;
• unique combat ability of each character;
• live audio phrases of real politicians;
• various gaming locations;
• available campaign mode and fast combat option;
• record statistics: fight with friends in the fast game passing!

A free and addictive game in which you play as John, a tough and good fighting stickman who walked the field when a zombie epidemic began. 

⭐ STICK FIGURE FEATURES ⭐
▪ Run, run, run!
▪ Awesome Parkour moves: climb platforms and hang on high places!
▪ Incredible melee fighting combos!
▪ Epic stickman fights and massive zombie hordes!
▪ Many platformer levels and a lot of waves to play!
▪ Many kind of weapons and strategies to shoot all the zombies!
▪ Be the best stickman warrior!
▪Climb walls, survive the apocalypse, break and kill some zombies. 
▪Run, trap and kill them within epic battles!

⭐ GAME FEATURES ⭐
▪ Save your progress online.
▪ Reach the top of the online leaderboards!
▪ The game can be played offline!
▪A really challenging game with simple controls and hardcore gameplay! 
▪Amazing perfomance: Play this game on any device and be the best zombie killer ever!
▪Did you run out of internet? No problem, it can be played offline!
▪This game is really addictive!

⭐HOW TO PLAY ⭐
▪ Use virtual analog controls to walk around the map;
▪ Run to avoid crazy zombies from biting you;
▪ Jump through many platforms and different levels!
▪ Use many weapons and upgrade them to get even more powerful
▪ Collect coins to upgrade your weapons to kill zombies faster!
▪ Kill as many zombies as you can!

⭐AVAILABLE GUNS⭐
▪ Sniper Rifle;
▪ SMG ;
▪ Shotgun;
▪ Pistol;
▪ Land Mines;
▪ Sentry Gun;
▪ Rocket Launcher (Bazooka);
▪ Baseball Bat with Nails;
▪ Chainsaw;

⭐POWERUPS⭐
▪ Super Speed;
▪ Shield ;
▪ Extra Life;

Download this game now for free, kill many zombies and be the most epic stickman ever! Now!

Mad City On The Edge - Break into the criminal city - Bazooka and a couple of dozen grenades help!
In this at first glance, a decent city full of corrupt cops and dangerous mafiosi - who will constantly attack you and your people. Bribe several policemen and begin to smash the illegal business of competitors, take a gun, a few grenades and start to establish your order in the city.
Passing many interesting missions in the criminal districts of the city. Enjoy realistic graphics of the city, and immerse yourself in the rampant and dangerous life of the city. Understand all policemen, become the main mafia in a criminal city and do not give cause for doubt in your authority.
In the open world, shooting with cars, you can act contrary to all laws, arrange racing with cars, games with good graphics without internet, free fire - you can rampage on the streets of the city, causing fear of pedestrians or stealing cars and even go to the police station and arrange spectacular skirmishes with the police.

Features:
- Interesting missions with a multi-hour plot to the passage;
- Exciting races for time and money;
- Complete freedom of action in the open world (do not follow missions only);
- After earning money, you can buy a ready-made business, apartments or a bank of your own that will consistently bring you money;
- A lot of interesting and cool cars.

Dive headlong into the atmosphere of Mad City be at the head of the mafia and let even the most fearless policemen fear you. After all, your glory of a mad gangster from a slum will outstrip you in this city!

PK Hay Lấy Cả Thiên Hạ
Ngự Long 3D  là một tựa game nhập vai quốc chiến có mật độ PK liên tục và dày đặc, phù hợp cho bất kỳ ai đam mê sự cuồng nhiệt trên các chiến trường. Ở phiên bản hiện tại trò chơi mang tới 3 phái gồm Bá Đao (đao), Ma Thương (thương) và Vũ Cơ (quạt). Mỗi phái đều có tạo hình và bộ kỹ năng riêng biệt. Đặc biệt 3 phái này còn có thể tự do chuyển đổi qua lại.
Về PK, Ngự Long 3D đảm bảo bất kỳ ai tham gia cũng sẽ được sống trong một chiến trường khổng lồ, khi hai phe Chính Tà đánh nhau liên tục ngày đêm. Tại đây người chơi còn có thể tận hưởng lại cảm giác mà dường như đã mất từ lâu như chặn cổng PK, khi phe Chính có thể đứng chặn cổng thành của phe Tà và ngược lại. Thứ hai, đó là PK và KS boss, khi người chơi có thể tiêu diệt một người chơi khác để chiếm lấy con boss cho riêng mình. Chỉ nghe tới đó mà nhiều game thủ đã rất nóng lòng muốn tận tay trải nghiệm siêu phẩm MMORPG này rồi.
Nếu, bạn là người thích trải nghiệm chiến trường PK và các hoạt động PVP trong game; 
Nếu, bạn muốn tận hưởng cảm giác làm vua, đứng đầu thiên hạ và điều khiển một quốc gia; 
Nếu, bạn chán nản với việc phải đánh quái săn kinh nghiệm ngày qua ngày và không có mục tiêu; 
Nếu bạn yêu thích sự trải nghiệm như đổi phái chuyển phe chỉ với vài thao tác;
Thì,…
Ngự Long 3D là tựa game MMORPG thích hợp nhất dành cho bạn.
Người chơi không còn chịu cảnh cày cuốc nhàm chán, mệt mỏi mà thay vào đó là tận hưởng sự nhiệt huyết, cảm giác hừng hực khí thế trên các chiến trường đa dạng từ cảnh sắc đến quy mô.
